import {Link} from 'react-router-dom';
import {motion} from 'framer-motion';

const Footer = () => {
    const exit = {
        exit: {
        opacity: 0,
        }
    };

    return(
            <div  >
                <div>
                <motion.h1 {...exit}>Thanks for reaching out I'll get back to you as soon as I can !</motion.h1>
                <Link to="/home"> back to home </Link>
                </div>
            </div>
    )
}

export default Footer;
